INSERT INTO `Cancellation` VALUES (1,'Very Flexible','Guests may cancel their Booking until 24 hours before the event start time and will receive a full refund (including all Fees) of their Booking Price. Bookings cancellations submitted less than 24 hours before the Event start time are not refundable.',24,100,50,0,100,100,0,100,100,100,1,'2017-06-09 22:43:35','2020-06-16 07:15:34',0,'3dd9f6cae0b7bf0643713ea9aedbbd8a.png','Cleaning fees are always refunded if the guest did not check in.\n\nThe RentALL Space service fee is refundable if the guest cancels before the trip starts. If a guest books a reservation that overlaps with any part of an existing reservation, we won’t refund the RentALL Space service fee if they decide to cancel.\n\nAccommodation fees (the total nightly rate you\'re charged) are refundable in certain circumstances as outlined below.\n\nIf there is a complaint from either party, notice must be given to RentALL Space within 24 hours of check-in.\n\nRentALL Space will mediate when necessary, and has the final say in all disputes.\n\nA reservation is officially canceled when the guest clicks the cancellation button on the cancellation confirmation page, which they can find in Dashboard > Your Bookings > Cancel.\n\nCancellation policies may be superseded by the Guest Refund Policy, extenuating circumstances, or cancellations by RentALL Space for any other reason permitted under the Terms of Service. Please review these exceptions.\n\nApplicable taxes will be retained and remitted.','Very Flexible: Full refund 1 day prior to arrival'),(2,'Flexible','Guests may cancel their Booking until 7 days before the event start time and will receive a full refund (including all Fees) of their Booking Price. Guests may cancel their Booking between 7 days and 24 hours before the event start time and receive a 50% refund (excluding Fees) of their Booking Price. Booking cancellations submitted less than 24 hours before the Event start time are not refundable.',168,100,50,0,100,100,0,100,100,100,1,'2017-06-09 22:46:10','2020-06-16 08:09:15',24,'0cc2779c7557f5bbb9aef0d6c48e4c71.png','Cleaning fees are always refunded if the guest did not check-in.\n\nThe RentALL Space service fee is refundable if the guest cancels before the trip starts. If a guest books a reservation that overlaps with any part of an existing reservation, we won’t refund the RentALL Space service fee if they decide to cancel.\n\nAccommodation fees (the total nightly rate you\'re charged) are refundable in certain circumstances as outlined below.\n\nIf there is a complaint from either party, notice must be given to RentALL Space within 24 hours of check-in.\n\nRentALL Space will mediate when necessary and has the final say in all disputes.\n\nA reservation is officially canceled when the guest clicks the cancellation button on the cancellation confirmation page, which they can find in Dashboard > Your Bookings > Cancel.\n\nCancellation policies may be superseded by the Guest Refund Policy, extenuating circumstances, or cancellations by RentALL Space for any other reason permitted under the Terms of Service. Please review these exceptions.\n\nApplicable taxes will be retained and remitted.','Flexible: Refund 7 days prior to arrival'),(3,'Standard 30 day','Guests may cancel their Booking until 30 days before the event start time and will receive a full refund (including all Fees) of their Booking Price. Guests may cancel their Booking between 30 days and 7 days before the event start time and receive a 50% refund (excluding Fees) of their Booking Price. Cancellations submitted less than 7 days before the Event start time are not refundable.',720,100,50,0,100,100,0,100,100,100,1,'2017-06-09 22:47:38','2020-06-16 08:11:38',168,'c1e068ed0e6d0ca62014e330a0cc0372.png','Cleaning fees are always refunded if the guest did not check in.\n\nThe RentALL Space service fee is refundable if the guest cancels before the trip starts. If a guest books a reservation that overlaps with any part of an existing reservation, we won’t refund the RentALL Space service fee if they decide to cancel.\n\nAccommodation fees (the total nightly rate you\'re charged) are refundable in certain circumstances as outlined below.\n\nIf there is a complaint from either party, notice must be given to RentALL Space within 24 hours of check-in.\n\nRentALL Space will mediate when necessary, and has the final say in all disputes.\n\nA reservation is officially canceled when the guest clicks the cancellation button on the cancellation confirmation page, which they can find in Dashboard > Your Bookings > Cancel.\n\nCancellation policies may be superseded by the Guest Refund Policy, extenuating circumstances, or cancellations by RentALL Space for any other reason permitted under the Terms of Service. Please review these exceptions.\n\nApplicable taxes will be retained and remitted.','Standard 30 day: Refund 30 Days prior to arrival'),(4,'Standard 90 day','Guests may cancel their Booking until 90 days before the event start time and will receive a full refund (including all Fees) of their Booking Price. Guests may cancel their Booking between 90 days and 14 days before the event start time and receive a 50% refund (excluding Fees) of their Booking Price. Cancellations submitted less than 14 days before the Event start time are not refundable.',2160,100,50,0,100,100,0,100,100,0,1,'2020-04-27 14:12:01','2020-06-16 08:12:34',336,'3ed06b6e7c1c23d6a4bda78ca0b15769.png','Cleaning fees are always refunded if the guest did not check-in.\n\nThe RentALL Space service fee is refundable if the guest cancels before the trip starts. If a guest books a reservation that overlaps with any part of an existing reservation, we won’t refund the RentALL Space service fee if they decide to cancel.\n\nAccommodation fees (the total nightly rate you\'re charged) are refundable in certain circumstances as outlined below.\n\nIf there is a complaint from either party, notice must be given to RentALL Space within 24 hours of check-in.\n\nRentALL Space will mediate when necessary and has the final say in all disputes.\n\nA reservation is officially canceled when the guest clicks the cancellation button on the cancellation confirmation page, which they can find in Dashboard > Your Bookings > Cancel.\n\nCancellation policies may be superseded by the Guest Refund Policy, extenuating circumstances, or cancellations by RentALL Space for any other reason permitted under the Terms of Service. Please review these exceptions.\n\nApplicable taxes will be retained and remitted.','Standard 90 day: 50% refund up until 1 week prior to arrival');
