  `companyName` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `isPartner` tinyint(1) DEFAULT '0',
  `nexudusAT` text COLLATE utf8mb4_unicode_ci,
  `nexudusExpireAT` date DEFAULT NULL,
  `nexudusRT` text COLLATE utf8mb4_unicode_ci,
  PRIMARY KEY (`userId`),
  UNIQUE KEY `profileId` (`profileId`),
  UNIQUE KEY `UserProfile_profileId_unique` (`profileId`),
